import{_ as a}from"./plugin-vue_export-helper.21dcd24c.js";import{o as e,c as i,a as l}from"./app.1e60a643.js";const r={},p=l('<h1 id="fillameapixel-\u7528\u6237\u534F\u8BAE" tabindex="-1"><a class="header-anchor" href="#fillameapixel-\u7528\u6237\u534F\u8BAE" aria-hidden="true">#</a> FillAmeaPixel \u7528\u6237\u534F\u8BAE</h1><p><strong>\u66F4\u65B0\u65E5\u671F\uFF1A2022 \u5E74 7 \u6708 10 \u65E5</strong> \uFF08<a href="/eula-changelog">\u66F4\u65B0\u65E5\u5FD7</a>\uFF09</p><p>\u5317\u4EAC\u73D0\u666E\u7F51\u7EDC\u6280\u672F\u5DE5\u4F5C\u5BA4\uFF08\u5982\u4E0B\u7B80\u79F0\u201C\u73D0\u666E\u201D\uFF09\u5728\u6B64\u7279\u522B\u63D0\u9192\u7528\u6237\u8BA4\u771F\u9605\u8BFB\u3001\u5145\u5206\u7406\u89E3\u672C\u300AFillAmeaPixel \u7528\u6237\u534F\u8BAE\u300B\uFF08\u4E0B\u79F0\u201C\u672C\u534F\u8BAE\u201D\uFF09\u3002</p><p>\u672C\u534F\u8BAE\u662F\u7528\u6237\u4E0E\u73D0\u666E\u4E4B\u95F4\u5173\u4E8E\u7528\u6237\u6CE8\u518C\u3001\u767B\u5F55 FillAmeaPixel \u670D\u52A1\u5668\uFF08\u5982\u4E0B\u4E5F\u79F0\u201C\u670D\u52A1\u5668\u201D\uFF09\u4EE5\u53CA\u4F7F\u7528\u670D\u52A1\u5668\u6E38\u620F\u670D\u52A1\u6240\u8BA2\u7ACB\u7684\u534F\u8BAE\u3002\u7528\u6237\u5E94\u8BA4\u771F\u9605\u8BFB\u3001\u5145\u5206\u7406\u89E3\u672C\u534F\u8BAE\u4E2D\u5404\u6761\u6B3E\uFF08\u7279\u522B\u662F\u6D89\u53CA\u514D\u9664\u6216\u8005\u9650\u5236\u73D0\u666E\u8D23\u4EFB\u3001\u4E89\u8BAE\u89E3\u51B3\u548C\u6CD5\u5F8B\u9002\u7528\u7684\u6761\u6B3E\uFF09\u5E76\u9009\u62E9\u63A5\u53D7\u6216\u4E0D\u63A5\u53D7\u672C\u534F\u8BAE\uFF08\u672A\u6210\u5E74\u4EBA\u5E94\u5728\u6CD5\u5B9A\u76D1\u62A4\u4EBA\u966A\u540C\u4E0B\u9605\u8BFB\uFF09\u3002\u7528\u6237\u6E38\u73A9\u670D\u52A1\u5668\u6216\u4E0B\u8F7D\u73D0\u666E\u8D44\u6E90\u7B49\u884C\u4E3A\u5C06\u89C6\u4E3A\u5BF9\u672C\u534F\u8BAE\u7684\u63A5\u53D7\uFF0C\u5E76\u540C\u610F\u63A5\u53D7\u672C\u534F\u8BAE\u5404\u9879\u6761\u6B3E\u7684\u7EA6\u675F\u3002\u5982\u7528\u6237\u4E0D\u540C\u610F\u672C\u534F\u8BAE\uFF0C\u8BF7\u52FF\u4F7F\u7528\u73D0\u666E\u8D44\u6E90\u6216\u670D\u52A1\u3002\u73D0\u666E\u6709\u6743\u4FEE\u8BA2\u672C\u534F\u8BAE\uFF0C\u66F4\u65B0\u540E\u7684\u534F\u8BAE\u6761\u6B3E\u5C06\u516C\u5E03\u4E8E\u73D0\u666E\u5B98\u65B9\u7F51\u7AD9\u3001\u6587\u6863\u4E2D\u5FC3\u53CA\u670D\u52A1\u5668\u5185\u3002</p><h2 id="_1-\u603B\u5219" tabindex="-1"><a class="header-anchor" href="#_1-\u603B\u5219" aria-hidden="true">#</a> 1 \u603B\u5219</h2><p>1.1 FillAmeaPixel \u662F\u7531\u73D0\u666E\u57FA\u4E8ENukkit\u81EA\u4E3B\u7814\u53D1\u7684\u300AMinecraft\u300B\u6E38\u620F\u670D\u52A1\u5668\uFF0C\u96B6\u5C5E\u4E8E Concrete Studio \u3002\u670D\u52A1\u5668\u7684\u6240\u6709\u6743\u53CA\u8FD0\u8425\u6743\u5F52\u73D0\u666E\u6240\u6709\u3002</p><p>1.2 \u7528\u6237\u5728\u4F7F\u7528\u670D\u52A1\u5668\u7684\u7279\u5B9A\u670D\u52A1\u65F6\uFF0C\u8BE5\u7B49\u670D\u52A1\u53EF\u80FD\u4F1A\u53E6\u6709\u5355\u72EC\u9002\u7528\u7684\u76F8\u5173\u534F\u8BAE\u3001\u653F\u7B56\u3001\u6307\u5F15\u3001\u5236\u5EA6\u6216\u89C4\u5219\u7B49\u3002\u6240\u6709\u670D\u52A1\u5668\u4E2D\u5DF2\u7ECF\u53D1\u5E03\u6216\u5C55\u793A\u7684\u6216\u5C06\u6765\u53EF\u80FD\u53D1\u5E03\u6216\u5C55\u793A\u7684\u6D89\u53CA\u76F8\u5173\u4E1A\u52A1\u7684\u534F\u8BAE\u3001\u653F\u7B56\u3001\u6307\u5F15\u3001\u5236\u5EA6\u6216\u89C4\u5219\u7B49\uFF0C\u5747\u6784\u6210\u5BF9\u672C\u534F\u8BAE\u7684\u6709\u6548\u8865\u5145\uFF0C\u5E76\u4F5C\u4E3A\u672C\u534F\u8BAE\u4E0D\u53EF\u5206\u5272\u7684\u7EC4\u6210\u90E8\u5206\u4E0E\u672C\u534F\u8BAE\u5177\u6709\u540C\u7B49\u6CD5\u5F8B\u6548\u529B\uFF0C\u5BF9\u7528\u6237\u5177\u6709\u6CD5\u5F8B\u4E0A\u7684\u7EA6\u675F\u529B\u3002</p><p>1.3 \u73D0\u666E\u6709\u6743\u5728\u5FC5\u8981\u65F6\u4FEE\u6539\u672C\u534F\u8BAE\u6761\u6B3E\uFF0C\u534F\u8BAE\u6761\u6B3E\u4E00\u65E6\u53D1\u751F\u53D8\u52A8\uFF0C\u5C06\u4F1A\u5728\u76F8\u5173\u9875\u9762\u4E0A\u516C\u5E03\u4FEE\u6539\u540E\u7684\u534F\u8BAE\u6761\u6B3E\u3002\u5982\u679C\u4E0D\u540C\u610F\u6240\u6539\u52A8\u7684\u5185\u5BB9\uFF0C\u7528\u6237\u5E94\u4E3B\u52A8\u53D6\u6D88\u76F8\u5173\u670D\u52A1\u6216\u505C\u6B62\u6E38\u73A9\u670D\u52A1\u5668\u3002\u5982\u679C\u7528\u6237\u7EE7\u7EED\u4F7F\u7528\u670D\u52A1\uFF0C\u5219\u89C6\u4E3A\u63A5\u53D7\u534F\u8BAE\u6761\u6B3E\u7684\u53D8\u52A8\u3002</p><p>1.4 \u7528\u6237\u987B\u7406\u89E3\uFF0C\u73D0\u666E\u4EC5\u4E3A\u7528\u6237\u63D0\u4F9B\u6E38\u620F\u670D\u52A1\u5668\u53CA\u76F8\u5173\u670D\u52A1\uFF0C\u9664\u6B64\u4E4B\u5916\u4E0E\u6E38\u620F\u8F6F\u4EF6\u53CA\u670D\u52A1\u6709\u5173\u7684\u8BBE\u5907\u6240\u9700\u7684\u8D39\u7528\uFF08\u5982\u6E38\u620F\u8F6F\u4EF6\u7EC8\u7AEF\u8D39\u7528\u3001\u4E3A\u63A5\u5165\u4E92\u8054\u7F51\u800C\u652F\u4ED8\u7684\u4E0A\u7F51\u8D39\uFF09\u5747\u5E94\u7531\u7528\u6237\u81EA\u884C\u8D1F\u62C5\u3002\u540C\u65F6\uFF0C\u7528\u6237\u5728\u6E38\u73A9\u670D\u52A1\u5668\u53CA\u4F7F\u7528\u76F8\u5173\u670D\u52A1\u65F6\u4F1A\u8017\u7528\u7528\u6237\u7684\u8BBE\u5907\u3001\u5E26\u5BBD\u3001\u6D41\u91CF\u7B49\u8D44\u6E90\u3002</p><h2 id="_2-\u7528\u6237\u6743\u5229\u548C\u4E49\u52A1" tabindex="-1"><a class="header-anchor" href="#_2-\u7528\u6237\u6743\u5229\u548C\u4E49\u52A1" aria-hidden="true">#</a> 2 \u7528\u6237\u6743\u5229\u548C\u4E49\u52A1</h2><p>2.1 \u60A8\u5728\u4F7F\u7528\u73D0\u666E\u670D\u52A1\u65F6\uFF0C\u5FC5\u987B\u9075\u5B88\u60A8\u6240\u5728\u8F96\u533A\u7684\u76F8\u5173\u6CD5\u5F8B\u6CD5\u89C4\u7684\u89C4\u5B9A\uFF0C\u60A8\u5E94\u540C\u610F\u5C06\u4E0D\u4F1A\u5229\u7528\u672C\u670D\u52A1\u8FDB\u884C\u4EFB\u4F55\u8FDD\u6CD5\u6216\u4E0D\u6B63\u5F53\u7684\u6D3B\u52A8\u3002\u5BF9\u4E8E\u4E2D\u534E\u4EBA\u6C11\u5171\u548C\u56FD\u516C\u6C11\uFF0C\u60A8\u4E0D\u5E94\u8FDB\u884C\u300A\u7F51\u7EDC\u5B89\u5168\u6CD5\u300B\u300A\u4E92\u8054\u7F51\u65B0\u95FB\u4FE1\u606F\u670D\u52A1\u7BA1\u7406\u89C4\u5B9A\u300B\u6240\u7981\u6B62\u7684\u884C\u4E3A\uFF0C\u5305\u62EC\u4F46\u4E0D\u9650\u4E8E\uFF1A</p><p>2.1.1 \u4E0A\u8F7D\u3001\u5C55\u793A\u3001\u5F20\u8D34\u3001\u4F20\u64AD\u6216\u4EE5\u5176\u4ED6\u65B9\u5F0F\u4F20\u9001\u542B\u6709\u4E0B\u5217\u5185\u5BB9\u4E4B\u4E00\u7684\u4FE1\u606F\uFF1A</p><ul><li>\u53CD\u5BF9\u5BAA\u6CD5\u6240\u786E\u5B9A\u7684\u57FA\u672C\u539F\u5219\u7684\uFF1B</li><li>\u5371\u5BB3\u56FD\u5BB6\u5B89\u5168\uFF0C\u6CC4\u9732\u56FD\u5BB6\u79D8\u5BC6\uFF0C\u98A0\u8986\u56FD\u5BB6\u653F\u6743\uFF0C\u7834\u574F\u56FD\u5BB6\u7EDF\u4E00\u7684\uFF1B</li><li>\u635F\u5BB3\u56FD\u5BB6\u8363\u8A89\u548C\u5229\u76CA\u7684\uFF1B</li><li>\u717D\u52A8\u6C11\u65CF\u4EC7\u6068\u3001\u6C11\u65CF\u6B67\u89C6\u3001\u7834\u574F\u6C11\u65CF\u56E2\u7ED3\u7684\uFF1B</li><li>\u7834\u574F\u56FD\u5BB6\u5B97\u6559\u653F\u7B56\uFF0C\u5BA3\u626C\u90AA\u6559\u548C\u5C01\u5EFA\u8FF7\u4FE1\u7684\uFF1B</li><li>\u6563\u5E03\u8C23\u8A00\uFF0C\u6270\u4E71\u793E\u4F1A\u79E9\u5E8F\uFF0C\u7834\u574F\u793E\u4F1A\u7A33\u5B9A\u7684\uFF1B</li><li>\u6563\u5E03\u6DEB\u79FD\u3001\u8272\u60C5\u3001\u8D4C\u535A\u3001\u66B4\u529B\u3001\u51F6\u6740\u3001\u6050\u6016\u6216\u8005\u6559\u5506\u72AF\u7F6A\u7684\uFF1B</li><li>\u4FAE\u8FB1\u6216\u8005\u8BFD\u8C24\u4ED6\u4EBA\uFF0C\u4FB5\u5BB3\u4ED6\u4EBA\u5408\u6CD5\u6743\u5229\u7684\uFF1B</li><li>\u542B\u6709\u865A\u5047\u3001\u6709\u5BB3\u3001\u80C1\u8FEB\u3001\u4FB5\u5BB3\u4ED6\u4EBA\u9690\u79C1\u3001\u9A9A\u6270\u3001\u4FB5\u5BB3\u3001\u4E2D\u4F24\u3001\u7C97\u4FD7\u3001\u7325\u4EB5\u3001\u6216\u5176\u4ED6\u9053\u5FB7\u4E0A\u4EE4\u4EBA\u53CD\u611F\u7684\u5185\u5BB9\uFF1B</li><li>\u542B\u6709\u4E2D\u56FD\u6CD5\u5F8B\u3001\u6CD5\u89C4\u3001\u89C4\u7AE0\u3001\u6761\u4F8B\u4EE5\u53CA\u4EFB\u4F55\u5177\u6709\u6CD5\u5F8B\u6548\u529B\u4E4B\u89C4\u8303\u6240\u9650\u5236\u6216\u7981\u6B62\u7684\u5176\u4ED6\u5185\u5BB9\u7684\uFF1B</li></ul><p>2.2 \u4E0D\u5F97\u5229\u7528\u73D0\u666E\u670D\u52A1\u4ECE\u4E8B\u4EE5\u4E0B\u6D3B\u52A8\uFF1A</p><ul><li>\u672A\u7ECF\u5141\u8BB8\uFF0C\u8FDB\u5165\u8BA1\u7B97\u673A\u4FE1\u606F\u7F51\u7EDC\u6216\u8005\u4F7F\u7528\u8BA1\u7B97\u673A\u4FE1\u606F\u7F51\u7EDC\u8D44\u6E90\u7684\uFF1B</li><li>\u672A\u7ECF\u5141\u8BB8\uFF0C\u5BF9\u8BA1\u7B97\u673A\u4FE1\u606F\u7F51\u7EDC\u529F\u80FD\u8FDB\u884C\u5220\u9664\u3001\u4FEE\u6539\u6216\u8005\u589E\u52A0\u7684\uFF1B</li><li>\u672A\u7ECF\u5141\u8BB8\uFF0C\u5BF9\u8FDB\u5165\u8BA1\u7B97\u673A\u4FE1\u606F\u7F51\u7EDC\u4E2D\u5B58\u50A8\u3001\u5904\u7406\u6216\u8005\u4F20\u8F93\u7684\u6570\u636E\u548C\u5E94\u7528\u7A0B\u5E8F\u8FDB\u884C\u5220\u9664\u3001\u4FEE\u6539\u6216\u8005\u589E\u52A0\u7684\uFF1B</li><li>\u6545\u610F\u5236\u4F5C\u3001\u4F20\u64AD\u8BA1\u7B97\u673A\u75C5\u6BD2\u7B49\u7834\u574F\u6027\u7A0B\u5E8F\u7684\uFF1B</li><li>\u8FDB\u884C\u4EFB\u4F55\u8BF8\u5982\u53D1\u5E03\u5E7F\u544A\u3001\u9500\u552E\u5546\u54C1\u7684\u5546\u4E1A\u884C\u4E3A\uFF0C\u6216\u8005\u8FDB\u884C\u4EFB\u4F55\u975E\u6CD5\u7684\u4FB5\u5BB3\u73D0\u666E\u5229\u76CA\u7684\u884C\u4E3A\uFF0C\u5982\u79C1\u81EA\u8D29\u5356\u6E38\u620F\u8D27\u5E01\u3001\u9053\u5177\u3001\u5916\u6302\u7B49\uFF1B</li><li>\u5176\u4ED6\u5371\u5BB3\u8BA1\u7B97\u673A\u4FE1\u606F\u7F51\u7EDC\u5B89\u5168\u7684\u884C\u4E3A\u3002</li></ul><p>2.3 \u60A8\u8FDD\u53CD\u672C\u534F\u8BAE\u6216\u76F8\u5173\u7684\u670D\u52A1\u6761\u6B3E\u7684\u89C4\u5B9A\uFF0C\u5BFC\u81F4\u6216\u4EA7\u751F\u7684\u4EFB\u4F55\u7B2C\u4E09\u65B9\u5411\u73D0\u666E\u4E0E\u5408\u4F5C\u516C\u53F8\u3001\u5173\u8054\u516C\u53F8\u4E3B\u5F20\u7684\u4EFB\u4F55\u7D22\u8D54\u3001\u8981\u6C42\u6216\u635F\u5931\uFF0C\u5305\u62EC\u5408\u7406\u7684\u5F8B\u5E08\u8D39\uFF0C\u60A8\u540C\u610F\u8D54\u507F\u73D0\u666E\u4E0E\u5408\u4F5C\u516C\u53F8\u3001\u5173\u8054\u516C\u53F8\uFF0C\u5E76\u4F7F\u4E4B\u514D\u53D7\u635F\u5BB3\u3002\u540C\u65F6\uFF0C\u73D0\u666E\u6709\u6743\u89C6\u60A8\u7684\u884C\u4E3A\u6027\u8D28\uFF0C\u91C7\u53D6\u5305\u62EC\u4F46\u4E0D\u9650\u4E8E\u5220\u9664\u53D1\u5E03\u4FE1\u606F\u5185\u5BB9\u3001\u6682\u505C\u4F7F\u7528\u8BB8\u53EF\u3001\u7EC8\u6B62\u670D\u52A1\u3001\u9650\u5236\u4F7F\u7528\u6E38\u620F\u5E10\u53F7\u3001\u8FFD\u7A76\u6CD5\u5F8B\u8D23\u4EFB\u7B49\u63AA\u65BD\u3002\u540C\u65F6\uFF0C\u73D0\u666E\u4F1A\u89C6\u53F8\u6CD5\u90E8\u95E8\u7684\u8981\u6C42\uFF0C\u534F\u52A9\u8C03\u67E5\u3002</p><p>2.4 \u5728\u4EFB\u4F55\u60C5\u51B5\u4E0B\uFF0C\u73D0\u666E\u90FD\u4E0D\u5BF9\u60A8\u6216\u4EFB\u4F55\u7B2C\u4E09\u65B9\u56E0\u672C\u534F\u8BAE\u4EA7\u751F\u7684\u4EFB\u4F55\u95F4\u63A5\u6027\u3001\u540E\u679C\u6027\u3001\u60E9\u6212\u6027\u7684\u3001\u5076\u7136\u7684\u3001\u7279\u6B8A\u6216\u60E9\u7F5A\u6027\u7684\u635F\u5BB3\u8D54\u507F\u627F\u62C5\u8D23\u4EFB\u3002</p><p>2.5 \u5173\u4E8E\u6E38\u73A9\u8FC7\u7A0B\u4E2D\u60A8\u56E0\u6E38\u620F\u60C5\u51B5\u800C\u4EA7\u751F\u7684\u5176\u4ED6\u6743\u5229\u4E0E\u4E49\u52A1\uFF0C\u8BF7\u67E5\u9605\u6211\u4EEC\u7684\u300A<a href="/players_covenant">\u73A9\u5BB6\u516C\u7EA6</a>\u300B\u3002</p><h2 id="_3-\u514D\u8D23\u58F0\u660E" tabindex="-1"><a class="header-anchor" href="#_3-\u514D\u8D23\u58F0\u660E" aria-hidden="true">#</a> 3 \u514D\u8D23\u58F0\u660E</h2><p>3.1 \u5982\u53D1\u751F\u4E0B\u8FF0\u60C5\u5F62\uFF0C\u73D0\u666E\u4E0D\u627F\u62C5\u4EFB\u4F55\u6CD5\u5F8B\u8D23\u4EFB\uFF1A</p><p>3.1.1 \u4F9D\u636E\u6CD5\u5F8B\u89C4\u5B9A\u6216\u76F8\u5173\u653F\u5E9C\u90E8\u95E8\u7684\u8981\u6C42\u63D0\u4F9B\u60A8\u7684\u4E2A\u4EBA\u4FE1\u606F\uFF1B</p><p>3.1.2 \u7531\u4E8E\u60A8\u7684\u4F7F\u7528\u4E0D\u5F53\u6216\u5176\u4ED6\u81EA\u8EAB\u539F\u56E0\u800C\u5BFC\u81F4\u4EFB\u4F55\u4E2A\u4EBA\u4FE1\u606F\u7684\u6CC4\u9732\uFF1B</p><p>3.1.3 \u4EFB\u4F55\u7531\u4E8E\u9ED1\u5BA2\u653B\u51FB\uFF0C\u7535\u8111\u75C5\u6BD2\u7684\u4FB5\u5165\uFF0C\u975E\u6CD5\u5185\u5BB9\u4FE1\u606F\u3001\u9A9A\u6270\u4FE1\u606F\u7684\u5C4F\u853D\uFF0C\u653F\u5E9C\u7BA1\u5236\u4EE5\u53CA\u5176\u4ED6\u4EFB\u4F55\u7F51\u7EDC\u3001\u6280\u672F\u3001\u901A\u4FE1\u7EBF\u8DEF\u3001\u4FE1\u606F\u5B89\u5168\u7BA1\u7406\u63AA\u65BD\u7B49\u539F\u56E0\u9020\u6210\u7684\u670D\u52A1\u4E2D\u65AD\u3001\u53D7\u963B\u7B49\u4E0D\u80FD\u6EE1\u8DB3\u60A8\u8981\u6C42\u7684\u60C5\u5F62\uFF1B</p><p>3.1.4 \u56E0\u7B2C\u4E09\u65B9\u5982\u8FD0\u8425\u5546\u7684\u901A\u8BAF\u7EBF\u8DEF\u6545\u969C\u3001\u6280\u672F\u95EE\u9898\u3001\u7F51\u7EDC\u3001\u7535\u8111\u6545\u969C\u3001\u7CFB\u7EDF\u4E0D\u7A33\u5B9A\u53CA\u5176\u4ED6\u56E0\u4E0D\u53EF\u6297\u529B\u9020\u6210\u7684\u635F\u5931\u7684\u60C5\u5F62\uFF1B</p><p>3.1.5 \u4F7F\u7528\u73D0\u666E\u4EA7\u54C1\u3001\u7A0B\u5E8F\u53CA\u670D\u52A1\u53EF\u80FD\u5B58\u5728\u7684\u6765\u81EA\u4ED6\u4EBA\u533F\u540D\u6216\u5192\u540D\u7684\u542B\u6709\u5A01\u80C1\u3001\u8BFD\u8C24\u3001\u4EE4\u4EBA\u53CD\u611F\u6216\u975E\u6CD5\u5185\u5BB9\u7684\u4FE1\u606F\u800C\u62DB\u81F4\u7684\u98CE\u9669\uFF1B</p><p>3.1.6 \u7528\u6237\u4E4B\u95F4\u901A\u8FC7\u670D\u52A1\u5668\u6216\u5176\u4ED6\u73D0\u666E\u4EA7\u54C1\u3001\u7A0B\u5E8F\u53CA\u670D\u52A1\u4E0E\u5176\u4ED6\u7528\u6237\u4EA4\u5F80\uFF0C\u56E0\u53D7\u8BEF\u5BFC\u6216\u6B3A\u9A97\u800C\u5BFC\u81F4\u6216\u53EF\u80FD\u5BFC\u81F4\u7684\u4EFB\u4F55\u5FC3\u7406\u3001\u751F\u7406\u4E0A\u7684\u4F24\u5BB3\u4EE5\u53CA\u7ECF\u6D4E\u4E0A\u7684\u635F\u5931\uFF1B</p><p>3.1.7 \u73D0\u666E\u660E\u6587\u58F0\u660E\uFF0C\u4E0D\u4EE5\u660E\u793A\u3001\u9ED8\u793A\u6216\u4EE5\u4EFB\u4F55\u5F62\u5F0F\u5BF9\u73D0\u666E\u53CA\u5176\u5408\u4F5C\u516C\u53F8\u670D\u52A1\u4E4B\u53CA\u65F6\u6027\u3001\u5B89\u5168\u6027\u3001\u51C6\u786E\u6027\u505A\u51FA\u62C5\u4FDD\u3002</p><p>3.1.8 \u60A8\u5728\u5229\u7528\u670D\u52A1\u5668\u6240\u53D1\u5E03\u7684\u4EFB\u4F55\u5185\u5BB9\u5E76\u4E0D\u4EE3\u8868\u548C\u53CD\u6620\u73D0\u666E\u7684\u4EFB\u4F55\u89C2\u70B9\u6216\u653F\u7B56\uFF0C\u73D0\u666E\u5BF9\u6B64\u4E0D\u627F\u62C5\u4EFB\u4F55\u8D23\u4EFB\u3002</p><h2 id="_4-\u5176\u4ED6" tabindex="-1"><a class="header-anchor" href="#_4-\u5176\u4ED6" aria-hidden="true">#</a> 4 \u5176\u4ED6</h2><h3 id="_4-1-\u9690\u79C1\u653F\u7B56" tabindex="-1"><a class="header-anchor" href="#_4-1-\u9690\u79C1\u653F\u7B56" aria-hidden="true">#</a> 4.1 \u9690\u79C1\u653F\u7B56</h3><p>4.1.1 \u8BF7\u67E5\u9605\u6211\u4EEC\u7684\u300A<a href="/privacy">\u9690\u79C1\u653F\u7B56</a>\u300B\uFF0C\u300A\u9690\u79C1\u653F\u7B56\u300B\u4E3A\u4E0E\u672C\u534F\u8BAE\u6548\u529B\u7B49\u540C\u4E14\u4E0D\u53EF\u5206\u5272\u7684\u4E00\u90E8\u5206\u3002</p><h3 id="_4-2-\u9002\u7528\u6CD5\u5F8B" tabindex="-1"><a class="header-anchor" href="#_4-2-\u9002\u7528\u6CD5\u5F8B" aria-hidden="true">#</a> 4.2 \u9002\u7528\u6CD5\u5F8B</h3><p>4.2.1 \u672C\u534F\u8BAE\u9002\u7528\u4E2D\u534E\u4EBA\u6C11\u5171\u548C\u56FD\u6CD5\u5F8B\u3002\u5982\u65E0\u76F8\u5173\u6CD5\u5F8B\u89C4\u5B9A\u7684\uFF0C\u5219\u53C2\u7167\u4F7F\u7528\u56FD\u9645\u5546\u4E1A\u60EF\u4F8B\u3002</p><p>4.2.2 \u5982\u679C\u53CC\u65B9\u53D1\u751F\u7EA0\u7EB7\uFF0C\u5E94\u672C\u7740\u53CB\u597D\u7684\u539F\u5219\u534F\u5546\u89E3\u51B3\uFF1B\u5982\u534F\u5546\u4E0D\u6210\uFF0C\u4EFB\u4F55\u4E00\u65B9\u5747\u53EF\u5411\u88AB\u544A\u4F4F\u6240\u5730\u6709\u7BA1\u8F96\u6743\u7684\u4EBA\u6C11\u6CD5\u9662\u63D0\u8D77\u8BC9\u8BBC\u3002\u82E5\u5355\u9879\u6761\u6B3E\u4E0E\u672C\u670D\u52A1\u6761\u6B3E\u5728\u7BA1\u8F96\u7EA6\u5B9A\u5185\u5BB9\u4E0A\u5B58\u5728\u51B2\u7A81\uFF0C\u5219\u5728\u5355\u9879\u6761\u6B3E\u7EA6\u675F\u8303\u56F4\u5185\u5E94\u4EE5\u5355\u9879\u6761\u6B3E\u4E3A\u51C6\u3002</p><h3 id="_4-3-\u72EC\u7ACB\u6027" tabindex="-1"><a class="header-anchor" href="#_4-3-\u72EC\u7ACB\u6027" aria-hidden="true">#</a> 4.3 \u72EC\u7ACB\u6027</h3><p>4.3.1 \u82E5\u672C\u534F\u8BAE\u4E2D\u7684\u67D0\u4E9B\u6761\u6B3E\u56E0\u6545\u65E0\u6CD5\u9002\u7528\uFF0C\u5219\u672C\u534F\u8BAE\u7684\u5176\u4ED6\u6761\u6B3E\u7EE7\u7EED\u9002\u7528\u4E14\u65E0\u6CD5\u9002\u7528\u7684\u6761\u6B3E\u5C06\u4F1A\u88AB\u4FEE\u6539\uFF0C\u4EE5\u4FBF\u5176\u80FD\u591F\u4F9D\u6CD5\u9002\u7528\u3002</p><p>4.3.2 \u672C\u534F\u8BAE\u6240\u6709\u6761\u6B3E\u7684\u6807\u9898\u4EC5\u4E3A\u9605\u8BFB\u65B9\u4FBF\uFF0C\u672C\u8EAB\u5E76\u65E0\u5B9E\u9645\u6DB5\u4E49\uFF0C\u4E0D\u80FD\u4F5C\u4E3A\u672C\u534F\u8BAE\u6DB5\u4E49\u89E3\u91CA\u7684\u4F9D\u636E\u3002</p><h3 id="_4-4-\u66F4\u65B0\u4E0E\u901A\u77E5" tabindex="-1"><a class="header-anchor" href="#_4-4-\u66F4\u65B0\u4E0E\u901A\u77E5" aria-hidden="true">#</a> 4.4 \u66F4\u65B0\u4E0E\u901A\u77E5</h3><p>4.4.1 \u73D0\u666E\u901A\u8FC7\u7535\u5B50\u90AE\u4EF6\u6216\u77ED\u4FE1\u6216\u7F51\u9875\u516C\u544A\u6216\u73D0\u666E\u8BA4\u4E3A\u9002\u5F53\u7684\u65B9\u5F0F\u901A\u77E5\u7ED9\u7528\u6237\uFF0C\u544A\u77E5\u7528\u6237\u670D\u52A1\u6761\u6B3E\u7684\u4FEE\u6539\u3001\u670D\u52A1\u53D8\u66F4\u53CA\u5176\u4ED6\u91CD\u8981\u4E8B\u9879\u3002\u73D0\u666E\u901A\u8FC7\u4EE5\u4E0A\u4EFB\u4E00\u65B9\u5F0F\u5411\u7528\u6237\u53D1\u62A5\u6D88\u606F\u540E\uFF0C\u7528\u6237\u672A\u57283\u65E5\u5185\u901A\u8FC7\u4E66\u9762\u65B9\u5F0F\u63D0\u51FA\u5F02\u8BAE\uFF0C\u89C6\u4E3A\u63A5\u53D7\u65B0\u6D88\u606F\u7684\u5185\u5BB9\u3002</p><p>4.4.2 \u672C\u534F\u8BAE\u66F4\u65B0\u65F6\u95F4\u4E3A 2022 \u5E74 7 \u6708 10 \u65E5\u3002</p>',40),h=[p];function d(n,t){return e(),i("div",null,h)}var _=a(r,[["render",d],["__file","eula.html.vue"]]);export{_ as default};
